export default class NamedNodeMap extends Object {
    [key: number]: {
        name: string;
        value: string;
    };
    constructor();
    setNamedItem(name: string, value: string): null | undefined;
    getNamedItem(name: string): {
        name: string;
        value: string;
    } | null;
    removeNamedItem(name: string): null;
}
